    const { handleAuth } = useContext(AuthContext);
    const navigate = useNavigate();

    return (
        <div>
            <input type="text" placeholder="Enter Name" />{" "}
            <input type="text" placeholder="Enter Age" />

            <button onClick={() => {
                handleAuth(true);
                //imparative way
                navigate("/")
                
            }}>Submit</button>
        </div>
    );
};
